<text transform="matrix(1 0 0 1 47.1162 93.043)"><tspan x="0" y="0" font-family="'Times-Roman'" font-size="20">I am an applied cognitive psychologist, </tspan><tspan x="0" y="24" font-family="'Times-Roman'" font-size="20">researcher, analyst, data scientist, engi</tspan><tspan x="307.09" y="24" font-family="'Times-Roman'" font-size="20">-</tspan><tspan x="0" y="48" font-family="'Times-Roman'" font-size="20">neer, web developer, designer, commu</tspan><tspan x="309.326" y="48" font-family="'Times-Roman'" font-size="20">-</tspan><tspan x="0" y="72" font-family="'Times-Roman'" font-size="20">nity leader, DJ, &amp; cyber punk. I am </tspan><tspan x="0" y="96" font-family="'Times-Roman'" font-size="20">currently most interested in utilizing </tspan><tspan x="0" y="120" font-family="'Times-Roman'" font-size="20">the breadth of my tools &amp; emerging </tspan><tspan x="0" y="144" font-family="'Times-Roman'" font-size="20">technologies to empower people from </tspan><tspan x="0" y="168" font-family="'Times-Roman'" font-size="20">the perspective of their existing com</tspan><tspan x="291.572" y="168" font-family="'Times-Roman'" font-size="20">-</tspan><tspan x="0" y="192" font-family="'Times-Roman'" font-size="20">munity that trades efforts in massive </tspan><tspan x="0" y="216" font-family="'Times-Roman'" font-size="20">scaling solutions for fludity &amp; human </tspan><tspan x="0" y="240" font-family="'Times-Roman'" font-size="20">connection. After traveling through </tspan><tspan x="0" y="264" font-family="'Times-Roman'" font-size="20">many expanding cities &amp; observing the </tspan><tspan x="0" y="288" font-family="'Times-Roman'" font-size="20">impact of global software companies </tspan><tspan x="0" y="312" font-family="'Times-Roman'" font-size="20">on culture &amp; affordability, it is time </tspan><tspan x="0" y="336" font-family="'Times-Roman'" font-size="20">that we break the cycle of avarice &amp; </tspan><tspan x="0" y="360" font-family="'Times-Roman'" font-size="20">cancerous growth that fails to account </tspan><tspan x="0" y="384" font-family="'Times-Roman'" font-size="20">for the human condition within diverse </tspan><tspan x="0" y="408" font-family="'Times-Roman'" font-size="20">environments. Technology is becoming </tspan><tspan x="0" y="432" font-family="'Times-Roman'" font-size="20">ever more accessible for both use &amp; </tspan><tspan x="0" y="456" font-family="'Times-Roman'" font-size="20">development, so there is no better time </tspan><tspan x="0" y="480" font-family="'Times-Roman'" font-size="20">than the present to use our massive </tspan><tspan x="0" y="504" font-family="'Times-Roman'" font-size="20">problem solving potential on a local </tspan><tspan x="0" y="528" font-family="'Times-Roman'" font-size="20">level, cultivating organic seeds that </tspan><tspan x="0" y="552" font-family="'Times-Roman'" font-size="20">will emanate through their real impact, </tspan><tspan x="0" y="576" font-family="'Times-Roman'" font-size="20">instead of vacuous attentional based </tspan><tspan x="0" y="600" font-family="'Times-Roman'" font-size="20">marketing that has become a corner</tspan><tspan x="284.873" y="600" font-family="'Times-Roman'" font-size="20">-</tspan><tspan x="0" y="624" font-family="'Times-Roman'" font-size="20">stone of corporate success.</tspan><tspan x="0" y="672" font-family="'Times-Roman'" font-size="20">My mission is to use the breadth of my </tspan><tspan x="0" y="696" font-family="'Times-Roman'" font-size="20">experience to create paradigm breaking </tspan><tspan x="0" y="720" font-family="'Times-Roman'" font-size="20">tools to solve various local problems in </tspan><tspan x="0" y="744" font-family="'Times-Roman'" font-size="20">order to help shift our collective mental </tspan><tspan x="0" y="768" font-family="'Times-Roman'" font-size="20">models of the potential of emerging </tspan><tspan x="0" y="792" font-family="'Times-Roman'" font-size="20">open-source technologies. The two </tspan><tspan
